@woods_dangaran updates 1960s California home by Craig Ellwood featuring Glazed walls, teak flooring and an original koi pond! Thoughts about the result?
The Moore House originally designed by Craig Ellwood and renovated by local firm Woods + Dangaran, led by Brett Woods and Joseph Dangaran, located in #Losangeles, #California and photographed by Joe Fletcher @joefletcherphoto.
